import React from "react";
import { Route , Switch } from "react-router-dom/cjs/react-router-dom.min";

const abc =()=>{
   "hello"
}


const App =()=>{
    return(
        <>
          <Switch>
            <Route path='/' component={abc}/>
          </Switch>        
          <h1>Belymon Infotech</h1>
        </>
    )
}

export default App;
